import React, { useState, useEffect } from 'react';
import './HealthManagement.css';

const HealthManagement = () => {
  const [activeTab, setActiveTab] = useState('recommendations');
  const [userProfile, setUserProfile] = useState(null);
  const [diseaseInput, setDiseaseInput] = useState('');
  const [recommendations, setRecommendations] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  // Fetch user profile on component mount
  useEffect(() => {
    fetchUserProfile();
  }, []);

  const fetchUserProfile = async () => {
    try {
      const token = localStorage.getItem('access_token');
      if (!token) {
        setError('Please log in to access health management features');
        return;
      }

      const response = await fetch('/api/v1/profiles/me', {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const profile = await response.json();
        setUserProfile(profile);
      } else {
        setError('Failed to fetch user profile');
      }
    } catch (err) {
      setError('Error fetching user profile');
    }
  };

  const getRecommendations = async () => {
    if (!diseaseInput.trim()) {
      setError('Please enter a medical condition');
      return;
    }

    setLoading(true);
    setError('');

    try {
      const token = localStorage.getItem('access_token');
      const response = await fetch('/api/v1/health-recommendations/disease-specific', {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          disease: diseaseInput,
          severity: 'moderate',
          user_context: {
            age: userProfile?.age || 30,
            gender: userProfile?.gender || 'not_specified',
            fitness_level: userProfile?.fitness_level || 'beginner'
          }
        })
      });

      if (response.ok) {
        const data = await response.json();
        setRecommendations(data);
      } else {
        const errorData = await response.json();
        setError(errorData.detail || 'Failed to get recommendations');
      }
    } catch (err) {
      setError('Error getting recommendations');
    } finally {
      setLoading(false);
    }
  };

  const getPersonalizedRecommendations = async () => {
    if (!userProfile) {
      setError('User profile not available');
      return;
    }

    setLoading(true);
    setError('');

    try {
      const token = localStorage.getItem('access_token');
      const response = await fetch('/api/v1/health-recommendations/personalized', {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          include_exercise: true,
          include_diet: true
        })
      });

      if (response.ok) {
        const data = await response.json();
        setRecommendations(data);
      } else {
        const errorData = await response.json();
        setError(errorData.detail || 'Failed to get personalized recommendations');
      }
    } catch (err) {
      setError('Error getting personalized recommendations');
    } finally {
      setLoading(false);
    }
  };

  const renderRecommendations = () => {
    if (!recommendations) return null;

    return (
      <div className="recommendations-container">
        {recommendations.exercise_recommendations && (
          <div className="recommendation-section">
            <h3>üèÉ‚Äç‚ôÇÔ∏è Exercise Recommendations</h3>
            <div className="recommendation-content">
              {recommendations.exercise_recommendations.exercises?.map((exercise, index) => (
                <div key={index} className="exercise-card">
                  <h4>{exercise.name}</h4>
                  <p><strong>Type:</strong> {exercise.type}</p>
                  <p><strong>Duration:</strong> {exercise.duration}</p>
                  <p><strong>Intensity:</strong> {exercise.intensity}</p>
                  <p><strong>Description:</strong> {exercise.description}</p>
                  {exercise.precautions && (
                    <p className="precautions"><strong>‚ö†Ô∏è Precautions:</strong> {exercise.precautions}</p>
                  )}
                </div>
              )) || (
                <div className="ai-recommendation">
                  <p>{recommendations.exercise_recommendations}</p>
                </div>
              )}
            </div>
          </div>
        )}

        {recommendations.dietary_recommendations && (
          <div className="recommendation-section">
            <h3>ü•ó Dietary Recommendations</h3>
            <div className="recommendation-content">
              {recommendations.dietary_recommendations.foods?.map((food, index) => (
                <div key={index} className="diet-card">
                  <h4>{food.category}</h4>
                  <p><strong>Recommended:</strong> {food.recommended?.join(', ')}</p>
                  <p><strong>Avoid:</strong> {food.avoid?.join(', ')}</p>
                  <p><strong>Notes:</strong> {food.notes}</p>
                </div>
              )) || (
                <div className="ai-recommendation">
                  <p>{recommendations.dietary_recommendations}</p>
                </div>
              )}
            </div>
          </div>
        )}

        {recommendations.general_advice && (
          <div className="recommendation-section">
            <h3>üí° General Health Advice</h3>
            <div className="recommendation-content">
              <p>{recommendations.general_advice}</p>
            </div>
          </div>
        )}
      </div>
    );
  };

  return (
    <div className="health-management">
      <div className="health-header">
        <h2>üè• Health Management System</h2>
        <p>Get personalized health recommendations based on your medical conditions</p>
      </div>

      <div className="tab-navigation">
        <button 
          className={`tab-button ${activeTab === 'recommendations' ? 'active' : ''}`}
          onClick={() => setActiveTab('recommendations')}
        >
          Disease Recommendations
        </button>
        <button 
          className={`tab-button ${activeTab === 'personalized' ? 'active' : ''}`}
          onClick={() => setActiveTab('personalized')}
        >
          Personalized Plan
        </button>
        <button 
          className={`tab-button ${activeTab === 'profile' ? 'active' : ''}`}
          onClick={() => setActiveTab('profile')}
        >
          Health Profile
        </button>
      </div>

      <div className="tab-content">
        {activeTab === 'recommendations' && (
          <div className="recommendations-tab">
            <div className="input-section">
              <h3>Get Disease-Specific Recommendations</h3>
              <div className="input-group">
                <input
                  type="text"
                  placeholder="Enter your medical condition (e.g., diabetes, hypertension)"
                  value={diseaseInput}
                  onChange={(e) => setDiseaseInput(e.target.value)}
                  className="disease-input"
                />
                <button 
                  onClick={getRecommendations}
                  disabled={loading}
                  className="get-recommendations-btn"
                >
                  {loading ? 'Getting Recommendations...' : 'Get Recommendations'}
                </button>
              </div>
            </div>
            {renderRecommendations()}
          </div>
        )}

        {activeTab === 'personalized' && (
          <div className="personalized-tab">
            <div className="input-section">
              <h3>Get Personalized Health Plan</h3>
              <p>Based on your complete health profile and medical history</p>
              <button 
                onClick={getPersonalizedRecommendations}
                disabled={loading || !userProfile}
                className="get-recommendations-btn"
              >
                {loading ? 'Generating Plan...' : 'Generate Personalized Plan'}
              </button>
            </div>
            {renderRecommendations()}
          </div>
        )}

        {activeTab === 'profile' && (
          <div className="profile-tab">
            <h3>Your Health Profile</h3>
            {userProfile ? (
              <div className="profile-info">
                <div className="profile-section">
                  <h4>Personal Information</h4>
                  <p><strong>Name:</strong> {userProfile.first_name} {userProfile.last_name}</p>
                  <p><strong>Age:</strong> {userProfile.age || 'Not specified'}</p>
                  <p><strong>Gender:</strong> {userProfile.gender || 'Not specified'}</p>
                  <p><strong>Fitness Level:</strong> {userProfile.fitness_level || 'Not specified'}</p>
                </div>

                <div className="profile-section">
                  <h4>Medical Information</h4>
                  <p><strong>Medical Conditions:</strong> {userProfile.medical_conditions || 'None specified'}</p>
                  <p><strong>Allergies:</strong> {userProfile.allergies || 'None specified'}</p>
                  <p><strong>Current Medications:</strong> {userProfile.current_medications || 'None specified'}</p>
                  <p><strong>Emergency Contact:</strong> {userProfile.emergency_contact || 'Not specified'}</p>
                </div>
              </div>
            ) : (
              <p>Loading profile information...</p>
            )}
          </div>
        )}
      </div>

      {error && (
        <div className="error-message">
          <p>‚ùå {error}</p>
        </div>
      )}
    </div>
  );
};

export default HealthManagement;
